import React from 'react';
import { useNavigate } from 'react-router-dom';
import styles from './Home.module.css'; // Estilos adicionais personalizados
import 'bootstrap/dist/css/bootstrap.min.css'; // Importação do CSS do Bootstrap

const Home = () => {
  const navigate = useNavigate();

  return (
    <div className="container d-flex justify-content-center align-items-center">
      <div className={`card ${styles.box} text-center`}>
        <h1 className={`card-title ${styles.title}`}>Portal do Funcionário</h1>
        <h2 className={`card-subtitle mb-4 ${styles.slogan}`}>A conexão rápida com sua empresa</h2>
        <div className="d-flex flex-column align-items-center gap-2">
          <button className={`btn btn-primary ${styles.btn} w-100 max-w-300`} onClick={() => navigate('/Login')}>
            Acessar
          </button>
          <button className={`btn btn-secondary ${styles.btn} w-100 max-w-300`} onClick={() => navigate('/Cadastrar')}>
            Cadastrar
          </button>
          <p className={`card-text ${styles.rodape}`}>Desenvolvido por Leonardo W O Dias</p>
        </div>
      </div>
    </div>
  );
};

export default Home;
